import React from "react";
import "./Header.scss";

import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="heading">
      <h2 className="heading__text">MY JOURNEY</h2>
      <div>
        <Link to="/">
          <h3>HOME</h3>
        </Link>
      </div>
    </div>
  );
};

export default Header;
